import React from "react";
import { BrowserRouter as Router, Routes, Route, Link } from "react-router-dom";
import GetForecasting from "./pages/GetForecasting"; // adjust path if you put it somewhere else

function App() {
  return (
    <Router>
      <div>
        <nav className="p-4 bg-gray-100">
          <Link to="/" className="mr-4">Home</Link>
          <Link to="/get-forecasting">Get Forecasting</Link>
        </nav>

        <Routes>
          <Route path="/" element={<h1 className="p-6">Welcome to Smart Kitchen!</h1>} />
          <Route path="/get-forecasting" element={<GetForecasting />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
